import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import notes from "../notes";
import Note from "./Note";

function newNotes(nDetail) {
  return (
    <Note key={nDetail.key} nTitle={nDetail.title} nContent={nDetail.content} />
  );
}

function App() {
  return (
    <div>
      <Header />
      {notes.map(newNotes)}
      <Footer />
    </div>
  );
}
export default App;
